import gql from 'graphql-tag';

// QUERY:
// gql imports graphql-tag that turns our string into a proper graphQL query.
const ALL_PRODUCTS_QUERY = gql`
  query ALL_PRODUCTS_QUERY {
    allProducts {
      id
      title
      author
      description
      price
      photo {
        id
        image {
          publicUrlTransformed
        }
        altText
      }
    }
  }
`;

const Products = () => {
  return (
    <div>Products</div>
  )
};

export default Products;
